function Navmenu() {
    return (
        <div className="text-light d-table-cell"
             style="max-width: 30%;min-width: 200px;min-height: 0px;background: var(--bs-gray-dark);position: sticky;display: inline-block;">
            <nav
                className="navbar navbar-dark align-items-start sidebar sidebar-dark accordion bg-gradient-primary p-0">
                <div className="container-fluid d-flex flex-column p-0">
                    <hr className="sidebar-divider my-0">
                        {/*<ul className="navbar-nav text-light" id="accordionSidebar">*/}
                        {/*    <li className="nav-item"><a className="nav-link active" href="index.html"><i*/}
                        {/*        className="fas fa-shopping-cart"></i><span>Заказ</span></a></li>*/}
                        {/*    <li className="nav-item"><a className="nav-link" href="profile.html"><i*/}
                        {/*        className="far fa-edit"></i><span>Редактор заказов</span></a></li>*/}
                        {/*</ul>*/}
                    </hr>
                </div>
            </nav>
        </div>
    );
}

export default Navmenu;
